const math = require("mathjs");

const generate = (usePredefinedValues = 0) => {
    // 1. Dynamic Parameter Selection
    // Extract variable names and context from the provided question.html.
    let speed, time;
    const units = "mph"; // assuming units are miles per hour based on the given question

    // 2. Value Generation
    if (usePredefinedValues === 1) {
        speed = 100; // predefined value in mph
        time = 5; // predefined value in hours
    } else {
        // Generate random realistic values within the constraints of the problem.
        speed = math.round(math.random(50, 120)); // random speed between 50 and 120 mph
        time = math.round(math.random(1, 10)); // random time between 1 and 10 hours
    }

    // 3. Computation Logic
    const distance = speed * time; // d = v * t

    return {
        params: {
            speed,
            time,
            units
        },
        correct_answers: {
            distance
        },
        intermediate: {
            // No intermediate steps necessary for this calculation.
        },
        nDigits: 3,
        sigfigs: 3
    };
};

module.exports = { generate };
